import React, { Component } from 'react';
import { Link, NavLink } from "react-router-dom";
// import LoginForm from './LoginForm'

class NavBar extends Component{

  render(){

    return(

      <ul className='nav-bar'>

      <Link to="/home">
      <li>
      Home
      </li>
      </Link>

      <Link to="/account">
      <li>
      Settings
      </li>
      </Link>


      <Link to="/">
<li>
      Log out
</li>
      </Link>

      </ul>
    )
  }
}

export default NavBar
